import React from "react";
import { NavLink } from "react-router-dom";

const Header = () => {
  return (
    <nav>
      <NavLink to="/">Home</NavLink>
      <NavLink to="/favorites">Favorite Games</NavLink>
      <NavLink to="/submit">Submit Game</NavLink>
    </nav>
  );
};

export default Header;
